import { Card } from "react-bootstrap";
import product1 from "./images/product1.png";
function Product() {
  const products = [
    {
      id: "prod_OzEcA7fxfluog3",
      name: "Haitai Honey Butter Chip Fromage Blanc 해태 허니버터칩 프로마쥬블랑",
      image: "royal-save-mart/src/components/images/product1.jpg",
      description: "60g",
      price: "$6",
    },
    {
      id: "prod_OzEjhjmSJdVRo5",
      name: "Nongshim Shin noodle 농심 신라면",
      image: "royal-save-mart/src/components/images/product2.jpg",
      description: "120g * 5EA",
      price: "$12.5",
    },
    {
      id: "prod_OzEhfoOiB4AsAw",
      name: "Paldo Instant Noodles with Black Bean Sauce Cup 팔도 뽀로로 짜장컵",
      image: "royal-save-mart/src/components/images/product3.jpg",
      description: "65g",
      price: "$2.5",
    },
    {
      id: "prod_OzES3NaoHtXCcO",
      name: "Lotte Kancho 롯데 칸쵸",
      image: "royal-save-mart/src/components/images/product4.jpg",
      description: "54g",
      price: "$3",
    },
    {
      id: "prod_OzEOXQ80ugyA4T",
      name: "Lotte Pepero Original 롯데 빼빼로 오리지널",
      image: "royal-save-mart/src/components/images/product5.jpg",
      description: "47g",
      price: "$5",
    },
    {
      id: "prod_OzEd8o2ZFdZV6h",
      name: "Seoul Food Honey Pop Corn Snack서울식품 허니 뻥이요",
      image: "royal-save-mart/src/components/images/product6.jpeg",
      description: "225g",
      price: "$6",
    },
  ];

  return (
    <>
      {products.map((product, i) => {
        return (
          <Card key={i}>
            <Card.Body>
              <Card.Img
                src={product.image}
                alt={product.name}
                className="img-fluid"
              />
              <Card.Title>{product.name}</Card.Title>
              <Card.Subtitle>{product.description}</Card.Subtitle>
              <Card.Text>{product.price}</Card.Text>
            </Card.Body>
          </Card>
        );
      })}
    </>
  );
}

export default Product;
